  constructor(private route: ActivatedRoute, private router: Router, private settingsService: SettingsService) {
    settingsService.settingsAdded$.subscribe(evt => {
      this.theme = evt.settings.theme;
      if (evt.settings.theme === 'dark') {
        this.options.map.mapType = 'DEFAULT';
      } else {
        this.options.map.mapType = 'DEFAULT';
      }
      this.options = {...this.options};
    });
  }

  ngOnInit() {
    this.chartType = this.tests[this.currentTest].type;
  }

  manageTheme() {
    return {
      'text-white': (this.theme === 'dark'),
      'bg-light': this.theme === 'light',
      'bg-dark': this.theme === 'dark'
    };
  }


  updateChartType(event) {
    console.log(this.chartType, event)
    this.chartType = event;
    this.tests[this.currentTest].type = this.chartType;
  }
  updateMapType(event) {
    console.log(this.mapType, event)
    this.mapType = event;
    this.options.map.mapType = this.mapType;
    this.options = {... this.options};
  }
